    data: |
      SELECT DISTINCT - + 35, - col2 + + - col1 * col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q6493.out
    data: |
      -35	-1440
      -35	-3264
      -35	-354
